Pills Time is a personal pharmacy assistant and one of the most convenient medication reminders. You won't forget to take your medicine – our pill reminder will send you a notification! Now improve your health and quickly defeat any disease is much easier.

Make your medication schedule in accordance with the instructions or recipe given to you by your doctor. Flexible configuration will help you to defer or postpone a regular pill intake. Your courses will be archived, so you can return to them as needed!

Our advantages:
- The schedule for the day, week, month;
- Courses by number of medications;
- Taking medicine daily, every few days, weeks, months;
- Any duration and repetition rates;
- Automatic calculation of the remaining medicine;
- The opportunity to save the current medication;
- History of medication doses directly in the calendar.
- Your own database of medicines, pills and vitamins.

Take care of your health – and Pills Time will help you with this!

Stress At Work is a pulse measuring tool that will let you track your heart rate during the day.

Stress At Work is:
- easy pulse rate measuring;
- convenient pulse rate statistics;;
- reminders to measure your pulse;
- notes on your recent activity and comments for each measurement session.

Track your heart rate level regularly and watch the ratio of your normal and quickened pulse rate in the statistics. 

HEART RATE TRACKING DURING THE DAY
- Measure your pulse rate whenever you want;
- Measurement graphs are marked with color depending on the pulse rate (normal or quickened);
- Check your heart rate during the last few hours, days, weeks;
- Add comments and notes about your mood and general condition.

CHECK THE STATISTICS
- Track your heart rate level regularly;
- Keep an eye on your pulse rate ratio and find out possible reasons for deviations.

NOTIFICATIONS
- Set timer to remind you to take your pulse;
- Adjust the appropriate time for notifications.

Keep an eye on your pulse, stay calm and healthy!

